type TabCharacteristicsProps = {
  vendorCode: string,
  type: string,
  stringCount: number,
}

function TabCharacteristics ({vendorCode, type }:TabCharacteristicsProps): JSX.Element {
  return (
    <table className="tabs__table">
      <tr className="tabs__table-row">
        <td className="tabs__title">Артикул:</td>
        <td className="tabs__value">SO754565</td>
      </tr>
      <tr className="tabs__table-row">
        <td className="tabs__title">Тип:</td>
        <td className="tabs__value">Электрогитара</td>
      </tr>
      <tr className="tabs__table-row">
        <td className="tabs__title">Количество струн:</td>
        <td className="tabs__value">6 струнная</td>
      </tr>
    </table>
  );
}

export default TabCharacteristics;
